QVariant
C2cImagesModel::data(const QModelIndex & index, int role) const
{
  if (!index.isValid() || index.row() < 0)
    return QVariant();

  if (index.row() >= m_items.count()) {
    qWarning() << "C2cImagesModel: Index out of bound";
    return QVariant();
  }

  const Item & item = m_items[index.row()];
  switch (role) {
  case DOCUMENT_ID:
    return item->document_id();
  case ACTIVITIES:
    return item->activities();
  case AUTHOR:
    return item->author();
  case CAMERA_NAME:
    return item->camera_name();
  case CATEGORIES:
    return item->categories();
  case DATE_TIME:
    return item->date_time();
  case ELEVATION:
    return item->elevation();
  case EXPOSURE_TIME:
    return item->exposure_time();
  case FILE_SIZE:
    return item->file_size();
  case FILENAME:
    return item->filename();
  case FNUMBER:
    return item->fnumber();
  case FOCAL_LENGTH:
    return item->focal_length();
  case HEIGHT:
    return item->height();
  case IMAGE_TYPE:
    return item->image_type();
  case ISO_SPEED:
    return item->iso_speed();
  case WIDTH:
    return item->width();
  default:
    break;
  }

  return QVariant();
}

