    return item->frequentation();
  case GLACIER_RATING:
    return item->glacier_rating();
  case HEIGHT_DIFF_DOWN:
    return item->height_diff_down();
  case HEIGHT_DIFF_UP:
    return item->height_diff_up();
  case HUT_STATUS:
